import React from "react";
const Sdata = [
  {
    imgsrc: web,
    title: "webtitle",
  },
  {
    imgsrc: App,
    title: "apptitle",
  },
  {
    imgsrc: react,
    title: "reacttitle",
  },
  {
    imgsrc: software,
    title: "software",
  },
  {
    imgsrc: java,
    title: "javatitle",
  },
  {
    imgsrc: python,
    title: "pythontitle",
  },
];
export default Sdata;
